import React from 'react';
import UDPComponent from './Components/UDPComponent';

const App = () => {
  return (
    <div>
      <UDPComponent localPort={3000} proxyHost="127.0.0.1" proxyPort={60000} />
      {/* <UDPComponent localPort={50001} proxyHost="127.0.0.1" proxyPort={50000} /> */}
    </div>
  );
};

export default App;
